import React from "react";
import Labrator from "../Images/Labrator.jpg";
import Pug from "../Images/Pug.jpg";
import Rot from "../Images/Rot.jpg";
import Beagle from "../Images/Beagle.jpg";
import Germanshepard from "../Images/Germanshepard.jpg";
import Golden from "../Images/Golden.jpg";
import { Button } from "react-bootstrap"; // Imported from 'react-bootstrap'

function Ourproducts() {
    return (
        <div className="row">
            <div className="col">
                <img src={Labrator} alt="Labrator" />
                <Button variant="primary">Labrator</Button>
            </div>

            <div className="col">
                <img src={Pug} alt="Pug" />
                <Button variant="primary">Pug</Button>
            </div>

            <div className="col">
                <img src={Rot} alt="Rot" />
                <Button variant="primary">Rot</Button>
            </div>

            <div className="col">
                <img src={Beagle} alt="Beagle" />
                <Button variant="primary">Beagle</Button>
            </div>

            <div className="col">
                <img src={Germanshepard} alt="German Shepherd" />
                <Button variant="primary">German Shepherd</Button>
            </div>

            <div className="col">
                <img src={Golden} alt="Golden Retriever" />
                <Button variant="primary">Golden Retriever</Button>
            </div>
        </div>
    );
}

export default Ourproducts;
